import "./note.css";
import { useEffect, useState } from 'react';

const Note = () => {

    const [posts, setPosts] = useState([]);

    useEffect(() => {
      fetch('http://localhost:9999/posts')
        .then(res => {
          return res.json();
        })
        .then(resdata => {
          console.log(resdata)
          setPosts(resdata)
        })
    }, [])

    return(
        <div className="note">
            <div className="note-title">
                <span>{posts[1].name}</span>
                <div className="note-title-date">
                    ~ <span>00</span>:<span>00</span> <span>7</span>/<span>11</span>
                </div>
            </div>
            <hr/>
            <div className="note-content">
                <h5>Note</h5>
                <p>{posts[0].description}</p>
            </div>
        </div>
    )
}

export default Note;
